        map->query.mode = MS_QUERY_MULTIPLE;

        map->query.filter.string = msStrdup(string);
        map->query.filter.type = MS_EXPRESSION;
        
        map->query.layer = self->index;
        map->query.rect = map->extent;

        status = self->status;
        self->status = 1;
        retval = msQueryByFilter(map);
        self->status = status;
        return retval;
