        colorObj *color;
        
        /* Check colors */
        if (red > 255 || green > 255 || blue > 255 || alpha>255 ||
            red<-1 || green<-1 || blue<-1 || alpha<0 ) {
            msSetError(12, "Invalid color", "colorObj()");
            return NULL;
        }
    
        color = (colorObj *)calloc(1, sizeof(colorObj));
